import React, { useState, useEffect } from "react";
import { performAnalysis } from "./AnalysisGet";
import {
  RadialBarChart,
  RadialBar,
  Tooltip,
  ResponsiveContainer,
} from "recharts";
import { ProgressBar } from "react-bootstrap";
import { FaInfoCircle } from "react-icons/fa"; // For information icons

const AnalysisDisplay = () => {
  const [analysisResults, setAnalysisResults] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const results = await performAnalysis();
        setAnalysisResults(results);
      } catch (err) {
        setError(err);
      }
    };

    fetchData();
  }, []);

  const formatValue = (value, isCurrency = false) => {
    if (isNaN(value) || value === undefined) {
      return isCurrency ? "$0.00" : "N/A";
    }
    return isCurrency ? `$${value.toFixed(2)}` : `${value.toFixed(2)}`;
  };

  if (error) {
    console.error("Error fetching analysis data:", error);
  }

  if (!analysisResults && !error) {
    return <div>Loading...</div>;
  }

  const {
    profitFactor = 0,
    winRate = 0,
    winningTrades = 0,
    losingTrades = 0,
    averageWin = 0,
    averageLoss = 0,
    winLossRatio = 0,
  } = analysisResults || {};

  return (
    <div className="analysis-container">
      {/* Profit Factor Card */}
      <div className="metric-card">
        <div className="metric-header">
          <span>
            Profit Factor <FaInfoCircle />
          </span>
        </div>
        <div className="metric-content">
          <ResponsiveContainer width="100%" height={120}>
            <RadialBarChart
              innerRadius="80%"
              outerRadius="100%"
              data={[{ value: profitFactor }]}
              startAngle={180}
              endAngle={0}
            >
              <RadialBar
                dataKey="value"
                fill={profitFactor >= 1 ? "#34a853" : "#ea4335"}
                cornerRadius={10}
              />
              <Tooltip formatter={(value) => value.toFixed(2)} />
            </RadialBarChart>
          </ResponsiveContainer>
          <p className="metric-value">{profitFactor.toFixed(2)}</p>
        </div>
      </div>

      {/* Win % Card */}
      <div className="metric-card">
        <div className="metric-header">
          <span>
            Win % <FaInfoCircle />
          </span>
        </div>
        <div className="metric-content">
          <ResponsiveContainer width="100%" height={120}>
            <RadialBarChart
              innerRadius="70%"
              outerRadius="100%"
              data={[{ value: winRate }]}
            >
              <RadialBar
                dataKey="value"
                fill={winRate >= 50 ? "#34a853" : "#ea4335"}
              />
              <Tooltip formatter={(value) => `${value.toFixed(2)}%`} />
            </RadialBarChart>
          </ResponsiveContainer>
          <p className="metric-value">{winRate.toFixed(2)}%</p>
          <div className="win-loss-count">
            <span className="win-count">{winningTrades}</span> /{" "}
            <span className="loss-count">{losingTrades}</span>
          </div>
        </div>
      </div>

      {/* Avg Win/Loss Trade Card */}
      <div className="metric-card">
        <div className="metric-header">
          <span>
            Avg win/loss trade <FaInfoCircle />
          </span>
        </div>
        <div className="metric-content">
          <p className="metric-value">{winLossRatio.toFixed(1)}</p>
          <ProgressBar>
            <ProgressBar
              now={(averageWin / (averageWin + averageLoss)) * 100}
              label={`$${formatValue(averageWin, true)}`}
              variant="success"
              key={1}
            />
            <ProgressBar
              now={(averageLoss / (averageWin + averageLoss)) * 100}
              label={`$${formatValue(averageLoss, true)}`}
              variant="danger"
              key={2}
            />
          </ProgressBar>
        </div>
      </div>
    </div>
  );
};

export default AnalysisDisplay;

